import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './LandingPage.css';

function LandingPage() {
  const [currentSlide, setCurrentSlide] = useState(0);
  const [theme, setTheme] = useState('default');
  const navigate = useNavigate();

  const carouselItems = [
    {
      image: 'https://www.adamenfroy.com/wp-content/uploads/AdobeStock_485691272.jpeg',
      title: 'Empower Your Ideas',
      description: 'Turn your concepts into reality with AI-powered tools.',
    },
    {
      image: 'https://images.bisnis.com/upload/img/pekerjaan_freelance.png',
      title: 'Work Smarter',
      description: 'Boost productivity with intelligent automation.',
    },
    {
      image: 'https://www.liveabout.com/thmb/dRmwxrDkQQffvSppdRQTA5h5ZnI=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/artist-working-on-painting-concentrating-in-studio--937161320-5c8f067546e0fb00016ee0e0.jpg',
      title: 'Creative Expression',
      description: 'Explore new artistic horizons through AI assistance.',
    },
    {
      image: 'https://www.careergirls.org/wp-content/uploads/2018/05/FashionDesigner_1920x1080.jpg',
      title: 'Design with AI',
      description: 'Craft designs with smart suggestions and creative boosts.',
    },
    {
      image: 'https://tuhoraonline.com/wp-content/uploads/2021/04/freelancer.jpg',
      title: 'Freelance Power',
      description: 'Stand out in the freelance world with AI help.',
    },
  ];

  const handleSignUpClick = () => {
    navigate('/signup');
  };

  const handleLoginClick = () => {
    navigate('/login');
  };

  const handleNextSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide + 1) % carouselItems.length);
  };

  const handleThemeChange = (event) => {
    setTheme(event.target.value);
  };

  useEffect(() => {
    const root = document.documentElement.style;
    const themeVars = {
      bakery: ['#F1C27D', '#D2691E'],
      tech: ['#4A90E2', '#FF6F61'],
      clothing: ['#C71585', '#FFD700'],
      handmade: ['#8A2BE2', '#FFD700'],
      default: ['#0d6efd', '#ffc107'],
    };

    root.setProperty('--primary-color', themeVars[theme][0]);
    root.setProperty('--accent-color', themeVars[theme][1]);
  }, [theme]);

  useEffect(() => {
    const slideInterval = setInterval(handleNextSlide, 5000);
    return () => clearInterval(slideInterval);
  }, []);

  return (
    <div>
      {/* === NAVIGATION === */}
      <nav className="landing-nav">
        <div className="nav-left">
          <div className="logo">
            <i className="fas fa-brain"></i>
            <span>AI Tools</span>
          </div>
        </div>
        <div className="nav-right">
          <a href="#about" className="nav-link">About</a>
          <select id="themeSwitcher" onChange={handleThemeChange} value={theme} className="theme-dropdown">
            <option value="default">Default</option>
            <option value="bakery">Bakery</option>
            <option value="tech">Tech</option>
            <option value="clothing">Clothing</option>
            <option value="handmade">Handmade</option>
          </select>
          <button className="auth-btn login-btn" onClick={handleLoginClick}>Login</button>
          <button className="auth-btn signup-btn" onClick={handleSignUpClick}>Sign Up</button>
        </div>
      </nav>

      {/* === CAROUSEL === */}
      <div className="carousel">
        {carouselItems.map((item, index) => (
          <div
            className={`carousel-slide ${index === currentSlide ? 'active' : ''}`}
            key={index}
            style={{ backgroundImage: `url(${item.image})` }}
          >
            <div className="carousel-caption">
              <h2>{item.title}</h2>
              <p>{item.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default LandingPage;
